#from BotDiario import BotDiario
from PySimpleGUI import PySimpleGUI as tela
from PySimpleGUI import Push, Image, Text


class TelaCacaPalavras:

    def __init__(self):
        tela.theme('DarkBlue15')

    def layoutMenu(self):
        imagem = b''

        letras = b''
        self.layout = [
            [tela.Button('', image_data=imagem)],
            [tela.Button('', image_data=letras)],
            [tela.Input(key='word')],
            [tela.Button('Jogar'), tela.Button('Sair')]



        ]
        return tela.Window('Selecao', layout=self.layout, element_justification='left', finalize=True)

    def iniciarTela(self):
        # tela.Image('Foto.png')
        # self.layouInicio()
        tela.popup(
            'Nesse caça-palavras temos três categorias: comida, corpo humano e nacionalidade! Tente encontrar ao menos 3.')
        self.layoutMenu = self.layoutMenu()
        words = ['abacate', 'acelga', 'chuchú', 'carne assada', 'carne', 'frango', 'tabule', 'baço', 'braço',
                 'cílio', 'mamilo', 'próstata', 'pélvis', 'estoniano', 'líbio', 'suíço', 'tailandês', 'tcheco', 'dente']

        contador = 0
        
        while True:
            janela, eventos, valores = tela.read_all_windows()

            if janela == self.layoutMenu and eventos == tela.WINDOW_CLOSED:
                
                self.layoutMenu.close()
                break

            if janela == self.layoutMenu and eventos == 'Jogar':

                if valores['word'].lower() in words:
                    if contador < 2:
                        contador = contador + 1
                        print(contador)
                        tela.popup('Parabens! Continue jogando..')
                    else:
                        tela.popup(
                            f'Parabéns, voce acertou {contador+1}, mas pode continuar jogando se quiser exercitar mais!')
                else:
                    tela.popup('Infelizmente voce errou!')
            if janela == self.layoutMenu and eventos == 'Sair':
                self.layoutMenu.close()
                break
